import React, { useState } from "react";
import "./App.css";
import GymCardGrid from "./components/GymCardGrid/GymCardGrid";

const App: React.FC = () => {
    const [blurBackground, setBlurBackground] = useState(false);

    return (
        <div className={blurBackground ? "app-container blurred" : "app-container"}>
            <GymCardGrid setBlurBackground={setBlurBackground} />
        </div>
    );
};

export default App;
